import React, { Component, useEffect, useState } from "react";
import "./App.css";

let App = () => {
  const App_ID = "fd66710f",
    App_Key = "b730ff582098b26929d3ced30bdb1a62	",
    ExReq = `https://api.edamam.com/api/recipes/v2?type=public&q=chicken&app_id=${App_ID}&app_key=${App_Key}`;

  const [counter, setCounter] = useState(0);
  const [title, setTitle] = useState("");
  let handelCounter = (c) => setCounter((c) => c + 1);
  let handelTitle = (v) => setTitle(v === "Mostafa Kadry");
  useEffect(() => {
    console.log(`use effect is work good`);
    document.title = title;
  });
  return (
    <div>
      <h1>Hello, World</h1>
      <input
        type="text"
        placeholder="What is recipe you need to query for ? ..."
      />
      <button onClick={handelCounter}>Query</button>
      {counter}

      <button onClick={handelTitle}> Change title </button>
    </div>
  );
};
export default App;
